import React from "react";
import { Button } from "@/components/ui/button";
import { FileText, Mail, Truck, BadgeDollarSign, LayoutDashboard, Eye, MessageSquareText, Heart, PlayCircle } from "lucide-react";

const ServiceCard = ({ icon: Icon, title, brand, description, buttons }) => (
  <div className="bg-white p-6 rounded-lg shadow text-left">
    <div className="flex items-start gap-4">
      <div className="bg-gray-100 p-3 rounded">
        <Icon className="w-8 h-8 text-red-500" />
      </div>
      <div>
        <h3 className="text-lg font-semibold leading-tight">{title}</h3>
        <p className="text-sm text-gray-500 mb-2">by {brand}</p>
        <p className="text-sm text-gray-700 mb-4">{description}</p>
        <div className="flex flex-wrap gap-3">
          {buttons.map((btn, i) => (
            <Button key={i} className="bg-blue-600 text-white hover:bg-blue-700 text-xs px-4 py-2 rounded">
              {btn}
            </Button>
          ))}
        </div>
      </div>
    </div>
  </div>
);

const ServicesPage = () => {
  return (
    <div className="p-6 space-y-8">
      <div className="flex justify-between items-center">
        <h2 className="text-xl font-bold">SERVICES</h2>
        <div className="flex gap-4">
          <Button variant="outline">Download Overview PDF</Button>
          <Button className="bg-blue-600 text-white hover:bg-blue-700">Contact Us To Get Started</Button>
        </div>
      </div>

      {/* Shipping Services */}
      <section>
        <h3 className="text-2xl font-semibold mb-4">SHIPPING SERVICES</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <ServiceCard
            icon={Truck}
            title="Target+ Buy Shipping"
            brand="Target"
            description="Save on shipping! We'll meet you wherever you're already rate shopping. Leverage our account number for always-on rates or integrate our shipping APIs with your rate shopper for a seamless experience."
            buttons={["Overview"]}
          />
        </div>
      </section>

      {/* Advertising Services */}
      <section>
        <h3 className="text-2xl font-semibold mb-4">ADVERTISING SERVICES</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <ServiceCard
            icon={BadgeDollarSign}
            title="Target Product Ads"
            brand="Roundel™"
            description="Give your product a boost with native, cost-per-click sponsored product ads on Target.com and the Target app by reaching high-intent bottom-funnel shoppers. Activate, manage, and report out on your media experiences with Roundel™ Media Studio!"
            buttons={["Manage Ads", "Overview"]}
          />
          <ServiceCard
            icon={LayoutDashboard}
            title="Digital Media Campaigns"
            brand="Roundel™"
            description="Drive awareness, consideration and conversion for your brands and products with world-class customer data, best-in-class media network, and actionable insights. Click to know more."
            buttons={["Roundel"]}
          />
        </div>
      </section>

      {/* Content Services */}
      <section>
        <h3 className="text-2xl font-semibold mb-4">CONTENT SERVICES</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <ServiceCard
            icon={Eye}
            title="3D Imaging Service"
            brand="Target"
            description="Offer guests an interactive experience with your products through 3D Imaging. Utilize our in-house service to enrich your PDP with features like 'View in 3D', 'See it in your space' and 'Plan a space with it.'"
            buttons={["Access 3D Service", "Overview"]}
          />
          <ServiceCard
            icon={MessageSquareText}
            title="Ratings & Reviews"
            brand="PowerReviews, Bazaarvoice, Yotpo and Sozie"
            description="Collect and share consumer generated reviews to give Target guests the confidence to choose your products. Click to know more."
            buttons={["Review Syndication", "Review Seeding"]}
          />
          <ServiceCard
            icon={FileText}
            title="Enhanced Content"
            brand="Syndigo and Salsify"
            description="Engage guests with buying guides, 360° views, and comparison charts published seamlessly to all of your Product Detail Pages on Target.com. Click to know more."
            buttons={["Syndigo", "Salsify"]}
          />
          <ServiceCard
            icon={Heart}
            title="Social Content"
            brand="Bazaarvoice"
            description="Source and display brand and user-generated social media content on product detail pages and select listing pages, to inspire guests. Click to know more."
            buttons={["Bazaarvoice"]}
          />
          <ServiceCard
            icon={PlayCircle}
            title="Video"
            brand="StoryXpress"
            description="Convert existing product images and descriptions into educational and high-performing video animations in just minutes. Click to know more."
            buttons={["StoryXpress"]}
          />
        </div>
      </section>
    </div>
  );
};

export default ServicesPage;
